import React from "react";
import "./bandeiraPais.css";
import ImagemPais from "bandeiraBOL";


export default function BandeiraPais(props) {

    return (
        <>  
                 
            <img src={ImagemPais} alt="Imagem do Pais Selecionado"/>
        
        </>
    )
}
